import {Form} from "react-bootstrap";
import {
    InputGroupAddon,
    InputGroupText,
    Input,
    InputGroup,
    FormGroup,
} from "reactstrap";

const NewPasswordModal = (props) => {
    const {user, setUser} = props
    return(
        <>
            <FormGroup>
                <Form.Label>비밀번호</Form.Label>
                <InputGroup className="input-group-alternative">
                    <InputGroupAddon addobType="prepend">
                        <InputGroupText>
                            <i className="ni ni-email-83" />
                        </InputGroupText>
                    </InputGroupAddon>
                    <Input
                    placeholder="비밀번호"
                    type="text"
                    onChange={(e) =>
                        setUser({
                        ...user,
                        userName: e.target.value,
                        })
                    }
                    value={user.userName}
                    />
                </InputGroup>
            </FormGroup>
        </>
    )
    
}

export default NewPasswordModal;
